    "2016-07-27T22:54:35.805088",nt"name": "upper-mississippi-river-wildlife-and-fish-refuge-narrative-report-january-february-march-1-4c55f",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Upper Mississippi
    River Wildlife and Fish Refuge outlines Refuge accomplishments from January through
    April of 1945. The report begins by summarizing the weather conditions, habitat
    conditions, water conditions, and food and cover during this period. Wildlife- including
    migratory birds, upland game birds, big game animals, furbearers, and fish- is also
    covered. The Refuge development and maintenance section discusses physical developments.
    Resource management is outlined; topics include haying, fur harvesting, and timber
    removal. A progress report on field investigations and applied research is also
    provided. The public relations section of the report describes recreational uses,
    Refuge visitors, fishing, and violations. Items of interest, N-R forms, and photographs
    are attached. A summarization of refuge activities is include for May 1, 1944 to
    April 30, 1945.",nt"license_title": "License Not Specified",nt"extras":
